import React from "react";
import { CircularProgress, Grid } from "@material-ui/core";
// hook
import { useFetch } from "../../../hooks";
// components
import ListrningAidCard from "./ListrningAidCard";

const ClientListeningAid = () => {
  const { data, isLoading } = useFetch("/listeningaids");

  const listeningAidList = data.map((information) => (
    <Grid key={information._id} item xs={12} sm={6} md={6} lg={4}>
      <Card className={classes.root}>
        <CardActionArea>
          <CardMedia
            component="img"
            alt="Contemplative Reptile"
            height="140"
            image="/static/images/cards/contemplative-reptile.jpg"
            title="Contemplative Reptile"
          />
          <CardContent>
            <Typography gutterBottom variant="h5" component="h2">
              Lizard
            </Typography>
            <Typography variant="body2" color="textSecondary" component="p">
              Lizards are a widespread group of squamate reptiles, with over
              6,000 species, ranging across all continents except Antarctica
            </Typography>
          </CardContent>
        </CardActionArea>
        <CardActions>
          <Button size="small" color="primary">
            Share
          </Button>
          <Button size="small" color="primary">
            Learn More
          </Button>
        </CardActions>
      </Card>
      <ListrningAidCard information={information} />
    </Grid>
  ));

  return (
    <div>
      {isLoading ? (
        <CircularProgress />
      ) : (
        <Grid container spacing={3}>
          {listeningAidList}
        </Grid>
      )}
    </div>
  );
};

export default ClientListeningAid;
